import logo from './logo.svg';
import './App.css';

function App() {
  const style = {
    backgroundColor: '#111111',
    padding: '16px',
    color: '#c1c1c1',
    fontSize: '12px'
  };
  return (
    <div className="App">
      <div style={style}>
        hi there
      </div>
    </div>
  );
}

export default App;

